import Navbar from '../Navbar/Navbar';
import Login from'../Login/Login'


function App({auth}) {

  return (
    <div className="App">
      {!auth.token && <Login/>}
      {auth.token &&<Navbar/>}
    </div>
  );
}

export default App;
